import styled from 'styled-components'

export const StyledDiv = styled.div`
    height: 100vh;
    display: flex; 
    align-items: center; 
    justify-content: center; 
    flex-flow: column;  
    
    div{
        width: 500px;
        height: 80px;
        display: flex; 
        align-items: center; 
        margin: 20px; 
        font-size: 3rem;
        font-weight: 700;    
        background: F6F6F6
        
    }
    a{
        text-decoration: none; 
        color: #031927; 
    }
    `
